import "./SearchBar.css";

const SearchBar = (props) => {
  return (
    <div className="search-bar__container">
      <div className="search-bar">
        <input
          // value={input}`
          onChange={(event) => props.onChange(event.target.value)}
          type="text"
          placeholder="🔍  搜尋"
        />
      </div>
    </div>
  );
};

export default SearchBar;
